import Topbar from '../../components/Topbar/Topbar'
import {Link} from "react-router-dom";
import './Reports.css'



export default function Reports() {
    return (
        <>
            <Topbar/>
                <div className="ReportsContainer">
                    <h2 className='ReportsMainText'>Отчеты</h2>
                    <br/>
                    <Link to='/ReportsNominations' className='linkDiv'>Отчет по номинациям</Link>
                    <Link to='/ReportsHistory' className='linkDiv'>Отчет по истории</Link>
            </div>
        </>
    )
}
